import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


let cursos = ['Codecademy','Udemy','LinuxAcademu','SafariBooks','AWS','Politecnica','Edex','Amazon']

const Card = ({curso}) => {
    return(
        <div className='card'>
            <img className='imgCard'></img>
            <div className='infoCard'>{curso}</div>
        </div>
    );
}

const ListCard = (props) => {

    const url = 'https://api.themoviedb.org/3/movie/top_rated?api_key=f13b35a7449050301ba5dbef9580d820&language=en-US&page=1'
    let listado = [];

    async function data(){

        let response = await fetch(url);
        if (response.ok) {
            let json = await response.json();
            listado = json.results.map(movie => <Card curso={movie.title}></Card>);
        } else {
            alert("HTTP-Error: " + response.status);
        }
    }

    return (<section className='groupCard' id={props.id}>
                <h2>{props.tipo}</h2>
                <div className='listCard'>
                    {listado}
                </div>     
            </section>)
}

const ListGroup = (props) => {
    const listados = ['Curso online','Certificaciones','Viajes'];
    return listados.map((e,i) => <ListCard tipo={e} id={i}></ListCard>)
}

const News = (props) => {
    return  (<section className='portada'>
            </section>)
}

const Main = (props) => {
    return (<main>
                <News></News>
                <ListGroup></ListGroup>
            </main>)
}

const Navbar = (props) => {
    return (<nav className='navbar'>
                <ul>
                    <li><a href="#0">Inicio</a></li>
                    <li><a href="#1">Sobre nosotros</a></li>
                    <li><a href="#2">Contacto</a></li>
                </ul>
            </nav>)
}

const Header = (props) => {
    return(<header>
                <Navbar></Navbar>
            </header>)
}

const App = (props) => {
    return(
        <div className='root_2'>
            <Header></Header>
            <Main></Main>
        </div>
    )
}


ReactDOM.render(<App></App>,document.getElementById('root'))
